import React, { useState } from 'react';
import './TrackList.css';
import Track from '../Track/Track';

function TrackList({ searchResults }) {

    return(
        <div className="TrackList">
            {searchResults.map(i => <Track />)}
        </div>
    )
}

export default TrackList;
